import React from 'react'
import {Router, Link} from "react-router-dom"




function Home() {
  return (
  <div>
        <Router>
        <Link to="/generatemealplan">Generate Meal Plan</Link>
        <Link to="/mealplans">View My MealPlans</Link>
        </Router>



        
  </div>
  )
}

export default Home
